        edm.createPropertyType( new PropertyType( Optional.absent(), DEM_05, "EMS Agency Service Area County(s)", Optional.of( "The county(s) within each state for which the agency formally provides service."), ImmutableSet.of(), EdmPrimitiveTypeKind.String, Optional.of(false), Optional.absent()));
