        edm.createPropertyType( new PropertyType( Optional.absent(), DEM_07, "EMS Agency Service Area ZIP Codes", Optional.of( "The ZIP codes for the EMS Agency's service area."), ImmutableSet.of(), EdmPrimitiveTypeKind.String, Optional.of(false), Optional.absent()));
        edm.createPropertyType( new PropertyType( Optional.absent(), DEM_08, "Primary Type of Service", Optional.of( "The primary service type provided by the agency."), ImmutableSet.of(), EdmPrimitiveTypeKind.String, Optional.of(false), Optional.absent()));
        edm.createPropertyType( new PropertyType( Optional.absent(), DEM_09, "Level of Service", Optional.of( "The level of service which the agency provides EMS care for every request for service (the minimum certification level). This may be the license level granted by the state EMS office."), ImmutableSet.of(), EdmPrimitiveTypeKind.String, Optional.of(false), Optional.absent()));
        edm.createPropertyType( new PropertyType( Optional.absent(), DEM_10, "Organization Status", Optional.of( "The primary organizational status of the agency. The definition of Volunteer or Non-Volunteer is based on state or local definitions."), ImmutableSet.of(), EdmPrimitiveTypeKind.String, Optional.of(false), Optional.absent()));
        edm.createPropertyType( new PropertyType( Optional.absent(), DEM_11, "Organizational Type", Optional.of( "The organizational structure from which EMS services are delivered (fire, hospital, county, etc.)"), ImmutableSet.of(), EdmPrimitiveTypeKind.String, Optional.of(false), Optional.absent()));
        edm.createPropertyType( new PropertyType( Optional.absent(), DEM_12, "EMS Agency Organizational Tax Status", Optional.of( "The EMS Agencies business/corporate organizational tax status"), ImmutableSet.of(), EdmPrimitiveTypeKind.String, Optional.of(false), Optional.absent()));
        edm.createPropertyType( new PropertyType( Optional.absent(), DEM_13, "Statistical Calendar Year", Optional.of( "The calendar year to which the information pertains for the EMS Agency and the specific EMS Agency Number (dAgency.02)."), ImmutableSet.of(), EdmPrimitiveTypeKind.Date, Optional.of(false), Optional.absent()));
